import React from 'react';
import {Nav, Navbar, NavDropdown} from "react-bootstrap";
import {NavLink} from "react-router-dom";

function Navigation() {
    return (
        <Navbar bg="color" sticky="top" variant="dark" expand="md" collapseOnSelect>
            <Navbar.Brand>
                spacefaXcts
            </Navbar.Brand>

            <Navbar.Toggle />
            <Navbar.Collapse>
                <Nav>
                    <NavLink to="/about" className="nav-link mx-auto">ABOUT</NavLink>
                    <NavLink to="/earth" className="nav-link mx-auto">EARTH</NavLink>
                    <NavLink to="/spotd" className="nav-link mx-auto">SPOTD</NavLink>
                    <NavDropdown id="mars-dropdown" title="MARS">
                        <NavDropdown.Item><NavLink to="/mars">MARS</NavLink></NavDropdown.Item>
                        <NavDropdown.Divider />
                        <NavDropdown.Item><NavLink to="/mars/spirit" className="nav-link mx-auto">SPIRIT</NavLink></NavDropdown.Item>
                        <NavDropdown.Item><NavLink to="/mars/opportunity" className="nav-link mx-auto">OPPORTUNITY</NavLink></NavDropdown.Item>
                        <NavDropdown.Item><NavLink to="/mars/curiosity" className="nav-link mx-auto">CURIOSITY</NavLink></NavDropdown.Item>
                    </NavDropdown>
                </Nav>
            </Navbar.Collapse>
        </Navbar>
    );
}

export default Navigation;

